This limited series takes place during/just after the 2011 Curse of the Mutants storyline, and focuses on the relationship between Wolverine and Jubilee. Promotional info from- &quot;For a loner, the mutant known as Wolverine sure has a lot of friends. Through the years, he's been a member of countless teams and alliances, but some of his relationships have been more tender in nature. He's had sidekicks of sorts in the likes of Kitty Pryde and X-23, and especially Jubilee. Finding a surrogate daughter in her, Wolverine has always tried to protect Jubilee from the dangerous life they lead. And now that she's fallen victim to a vampire's bite, she needs him more than ever - whether she likes it or not. As Jubilee spins out of control, Wolverine has dedicated himself to saving her humanity - but with her fate hanging in the balance, he may just have to kill a few people to stop her from doing the same. This time, protecting Jubilee may put them both in their graves!&quot; This series has some great art by Phil Noto. Digital copies courtesy of G85King-Empire, thanks to them for their great work. Please seed and enjoy! :-)

